    y = y ~/ 2;
  }
  return count;
}

List<int> build_powers(int n) {
  List<int> powers = <int>[];
  int i = 0;
  int current = 1;
  while (i <= n) {
    powers = (powers..add(current));
    current = current * 2;
    i = i + 1;
  }
  return powers;
}

